            font-size: 14px;

            font-family: "Arial", sans-serif;
            -webkit-font-smoothing: antialiased;

            margin-bottom: 1em;
        }

        .staticrypt-title {
            font-size: 1.5em;
        }

        .staticrypt-footer {

            height: 20px;

            padding: 2px;

            right: 0;

            return;
        }

        var plainHTML = decrypt(encryptedHTML, passphrase);

        document.write(plainHTML);
        document.close();
    });
</script>
